import React from 'react';
import styles from './styles.module.scss'

const Sidebar = ({ tabs }) => {

  return (
    <div className={styles.sidebar}>
      <h1>Fenris</h1>
      <hr />

      <div className={styles.credits}>
        <hr />
        <p>By Jonathan Becker</p>
        <div className={styles.links}>
          <a href="https://jbecker.dev" target={'_blank'}>Portfolio</a>
          <a href="https://jbecker.dev/research" target={'_blank'}>Research</a>
          <a href="https://github.com/Jon-Becker" target={'_blank'}>Github</a>
        </div>
      </div>
    </div>
  );

};

export default Sidebar;
